// Channels

import React from 'react';
import PropTypes from 'prop-types';
import './profile.scss';

const Profile = props => {
    return (
        <section className="profile">
            <div className="container">
                <p className='col-md-12 ' >Thông tin tài khoản </p>
            </div>
        </section>
    );
};

export default Profile;
